import { useState } from "react";
import Footer from "./Footer";
import Main from "./Main";
import Navbar from "./Navbar";
import Sidebar from "./Contact";

import cup from "../assets/cup2.png";

function Home() {
  return (
    <div>
      <div>
        <h1 className="text-white text-7xl font-extralight mt-10">
          Great coffee for<br></br> some joy
        </h1>
      </div>
      <div className="bg-[#774b31] h-screen relative flex items-center justify-end px-36">
        <div className="absolute right-24 w-80 h-80 bg-white rounded-full blur-2xl opacity-40"></div>
        <img src={cup} alt="cup" className="relative w-64 h-72" />
      </div>

      <button > </button>
    </div>
  );
}

export default Home;
